script: |
  super -f text -I q13107.spq | sort > q13107.out

inputs:
  - name: q13107.spq
    data: |
      SELECT DISTINCT - COUNT ( * ) / COUNT ( * ) AS col2, - 33 + + MIN ( CAST ( NULL AS REAL ) ) col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q13107.out
    data: |
      -1	-
